class Solution(object):
    def getPermutation(self, n, k):
        """
        :type n: int
        :type k: int
        :rtype: str
        """

        def factorial(n):
            if n == 0:
                return 1
            return n * factorial(n - 1)

        def getPermutation(n, k):
            if n == 1:
                return [k]
            else:
                fact = factorial(n - 1)
                index = (k - 1) // fact
                k = k % fact
                return [index + 1] + getPermutation(n - 1, k)

        return ''.join(map(str, getPermutation(n, k)))

