                neighbors.append(swap(board, i, j))
            if i < 1:
                neighbors.append(swap(board, i, j))
            if j < 2:
                neighbors.append(swap(board, i, j))
            if j > 1:
                neighbors.append(swap(board, i, j))
            return neighbors

        def bfs(board):
            queue = [(board, 0)]
            visited = set()
            while queue:
                board, moves = queue.pop(0)
                if isSolved(board):
                    return moves
