        """
        :type nums: List[int]
        :rtype: int
        """

        n = len(nums)
        if n < 3:
            return 0

        dp = [0] * n
        for i in range(n):
            for j in range(i):
                if nums[i] - nums[j] == nums[j] - nums[j - 1]:
